  false,\n\t\"url\": null,\n\t\"notes\": \"During the summer of 2015, a U.S. Fish
  and Wildlife Service Summer Faculty Fellowship was awarded to preform small mammal
  research on the Baca National Wildlife Refuge.  The objective of this research was
  to determine if browsing by elk affected small mammal communities in the riparian
  areas, where willow regeneration was visibly impacted by the browsing. Surveying
  methods, including trapping, and discussion of the analysis are provided, as well
  as things learned by the summer fellowship student.\",\n\t\"license_title\": \"License
